import { Link } from 'react-router-dom';
import Nav from '../components/Nav';
import Footer from '../components/Footer'


function Empty(props) {

    document.title = '404'

    return <div >
        <
        Nav / >
        <
        div className = 'container' >
        <
        h3 > 404 Not Found < /h3> <
        Link to = '/' > Back to Home page < /Link> <
        /div> <
        Footer / >

        <
        /div>
}

export default Empty;
